import { useState, useEffect } from "react";
import game from "../views/places/game";
import "./App.css";

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/api")
      .then(res => res.json())
      .then(data => setData(data.message));
  }, []);

  return <div className="App"> { game }</div>;
}

export default App;
